import React from 'react';
import './card.css';

function Card(props) {
  return (
    <div className='card'>
      <img
        className='ct__image'
        src={require(`../../../Assets/Images/Project Image/${props.post.blogImage}`)}
        alt='post image'
      />
      <h1></h1>
    </div>
  );
}

export default Card;
